import React from 'react';
import ReactDOM from 'react-dom';

const ToDoHeader = () =>{
    return <header>
        <h1> ToDoS</h1>
        <ToDoSearch/>
    </header>
}
const ToDoSearch = ()=>{
    return <input type='text' placeholder="Input do wish" />
}

const ToDoList = () =>{
    const item = ['first if null', 'second']
    return (
        <ul >
             <li>{item[0]}</li>
             <li>{item[1]}</li>
        </ul>
    );
}

const ToDoCount = () => {
    return (
        <span>1 item left</span>
    );
};

const ToDoFilterCompleted = () => {
    return (
        <li>
            <button>Completed</button>
        </li>
    );
}
const ToDoFilterActive = () => {
    return (
        <li>
            <button>Active</button>
        </li>
    );
}
const ToDoFilterSelected = () => {
    return (
        <li>
            <button>Selected</button>
        </li>
    );
}
const ToDoFilter = ()=>{
    return (
        <ul>
            <ToDoFilterSelected/>
            <ToDoFilterActive/>
            <ToDoFilterCompleted/>
        </ul>
    );
}

const ToDoClear = () => {
    return (
        <button className="clear-completed">Clear completed</button>
    );
}

const ToDoFooter = () => {
    return (
        <footer>
            <ToDoCount/>
            <ToDoFilter/>
            <ToDoClear/>
        </footer>
    );
}
const ToDoMain = ()=>{
    return (
      <section>
          <ToDoList/>
          <ToDoFooter/>
      </section>
    );
}
const ToDoApp = () =>{
    return (
        <section>
            <ToDoHeader/>
          <ToDoMain/>
        </section>
    );
}
const app = <ToDoApp/>;
ReactDOM.render(app,  document.getElementById('root'))


